    [],nt"num_tags": 0,nt"name": "dissolved-inorganic-carbon-alkalinity-temperature-salinity-and-other-variables-collected-from-de67be",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0115174 includes chemical,
    discrete sample, physical and profile data collected from THOMAS WASHINGTON in the
    North Pacific Ocean and South Pacific Ocean from 1991-08-31 to 1991-10-01 and retrieved
    during cruise WOCE_P16C. These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11),
    CHLOROFLUOROCARBON-12 (CFC-12), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3,
    DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE,
    NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE, Tritium (Hydrogen
    isotope) and WATER TEMPERATURE. The instruments used to collect these data include
    CTD and bottle. These data were collected by Charles D. Keeling and Peter Guenther
    of Scripps Institution of Oceanography and Catherine Goyet of University of Perpignan
    via Domitia; Institute of Modeling and Analysis of Geo-Environment and Health as
    part of the WOCE_P16C data set.nnThe World Ocean Circulation Experiment (WOCE) was
    a major component of the World Climate Research Program with the overall goal of
